収納に困りがちな洗濯機周りを、有効に活用できる突っ張りランドリーラックです。<br>丈夫でさびにくいステンレス巻きパイプを使用しています。<br>棚は小物なども落ちにくいように、仕切り付きのメッシュパネルになっています。<br>棚の高さは自由に調節が可能です。<br>◆家庭日用品 <br><br>サイズ・容量 <br>【商品サイズ(約mm)】W670～970×D310×H2000～2700<br>【商品重量(g)】3800<br>【パッケージサイズ(約mm)】W327×D86×H1023<br>●適合洗濯機サイズ（目安）：幅59～91cmまでの一般的な全自動から二層式の洗濯機 <br><br>規格<br>■素材・成分：ステンレス巻きスチールパイプ、スチール、ABS樹脂、合成ゴム<br><br><!--GoQSystemレビュー自動更新ツールワイド--><table align="center" width="650" border="0" cellpadding="0" cellspacing="0" bgcolor="#FFFFFF"><tr><td><table align="center" width="650" border="0" cellpadding="0" cellspacing="0" bgcolor="#FFFFFF"><tr><td align="center" valign="bottom" bgcolor="#cccccc"><img src="http://www.rakuten.ne.jp/gold/ssk-1/goqsystem_review/img/rev.jpg" width="650" id="rev_head" /></td></tr></table><table align="center" width="648" border="0" cellpadding="0" cellspacing="0" bgcolor="#CCCCCC" style="border-left:solid;border-left-width:1px;border-right:solid;border-right-width:1px;border-bottom:solid;border-bottom-width:1px;border-color:#CCCCCC;"><tr><td align="center" bgcolor="#FFFFFF"><div class="ifrm-container" style="width:648px;height:446px;overflow:auto;-webkit-overflow-scrolling:touch;"></div></td></tr></table></td></tr></table><!--GoQSystemレビュー自動更新ツールワイド--><br><br><br>[広告文責]有限会社ワイズギフト<br>【TEL】050-3736-2504<br><STYLE TYPE="text/css"> 
